import React from 'react';
import styled from 'styled-components';
import bgImage from './fondo_login.jpg'; // Reemplaza con la ruta de tu imagen de fondo
import logo from './logo_blanco.png'; // Reemplaza con la ruta de tu logo

const Container = styled.div`
    display: flex;
    height: 100vh;
    width: 100vw;
    position: relative;
    background-image: url(${bgImage});
    background-size: cover;
    background-position: center;
`;

const BlurOverlay = styled.div`
    position: absolute;
    top: 0;
    right: 0;
    width: 100%;
    height: 100%;
    background: rgba(33, 59, 107, 0.4);
    backdrop-filter: blur(15px);
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    padding: 20px;
`;

const Logo = styled.img`
    width: 200px;
    height: auto;
    margin-bottom: 20px;
`;

const Title = styled.h1`
    font-family: 'Hint Vadodara', sans-serif;
    color: white;
    font-size: 2rem;
    text-align: center;
    margin: 0;
`;

const ContentContainer = styled.div`
    display: flex;
    flex-direction: row;
    width: 70%;
    height: 60%;
    background: rgba(255, 255, 255, 0.9);
    padding: 20px;
    border-radius: 10px;
    box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
    overflow: hidden;
    @media (max-width: 768px) {
        width: 90%;
    }
    @media (max-width: 480px) {
        flex-direction: column;
        height: auto;
    }
`;

const EvaluadoresContainer = styled.div`
    flex: 1;
    padding: 10px;
    overflow-y: auto;
    border-right: 1px solid #ccc;
    @media (max-width: 480px) {
        border-right: none;
        border-bottom: 1px solid #ccc;
    }
`;

const EmprendimientosContainer = styled.div`
    flex: 1;
    padding: 10px;
    overflow-y: auto;
    @media (max-width: 480px) {
        border-top: 1px solid #ccc;
    }
`;

const EvaluadorItem = styled.div`
    padding: 10px;
    cursor: pointer;
    color: black;
    &:hover {
        background-color: #67157D;
        color: white;
    }
    margin-bottom: 10px;
    border-radius: 5px;
`;

const EmprendimientoItem = styled.div`
    padding: 10px;
    cursor: pointer;
    color: black;
    background: ${props => (props.selected ? '#67157D' : 'white')};
    color: ${props => (props.selected ? 'white' : 'black')};
    &:hover {
        background-color: #67157D;
        color: white;
    }
    margin-bottom: 10px;
    border-radius: 5px;
`;

const ButtonContainer = styled.div`
    margin-top: 20px;
    display: flex;
    flex-direction: column;
    gap: 10px;
`;

const Button = styled.button`
    padding: 10px 20px;
    border-radius: 50px;
    border: none;
    background: #213B6B;
    box-shadow: 0px 4px 8px rgba(101, 91, 127, 0.3);
    color: white;
    font-family: 'Hint Vadodara', sans-serif;
    font-size: 1rem;
    font-weight: 400;
    cursor: pointer;
    transition: background 0.3s;
    &:hover {
        background: #67157D;
    }
`;

const AsignacionEmprendimientos = () => {
    const [evaluadores, setEvaluadores] = useState([]);
    const [emprendimientos, setEmprendimientos] = useState([]);
    const [selectedEvaluador, setSelectedEvaluador] = useState(null);
    const [selectedEmprendimientos, setSelectedEmprendimientos] = useState([]);
    const [loading, setLoading] = useState(true);

    const fetchEvaluadores = async () => {
        // Datos de ejemplo para evaluadores
        const data = [
            { id: 1, nombre: 'Juan Pérez' },
            { id: 2, nombre: 'María López' },
            { id: 3, nombre: 'Pedro Fernández' },
        ];
        setEvaluadores(data);
    };

    const fetchEmprendimientos = async () => {
        // Datos de ejemplo para emprendimientos
        const data = [
            { id: 1, nombre: 'Emprendimiento 1' },
            { id: 2, nombre: 'Emprendimiento 2' },
            { id: 3, nombre: 'Emprendimiento 3' },
        ];
        setEmprendimientos(data);
    };

    useEffect(() => {
        fetchEvaluadores();
        fetchEmprendimientos();
        setLoading(false);
    }, []);

    const handleEvaluadorClick = (evaluador) => {
        setSelectedEvaluador(evaluador);
    };

    const handleEmprendimientoClick = (emprendimientoId) => {
        setSelectedEmprendimientos(prev => 
            prev.includes(emprendimientoId) ? prev.filter(id => id !== emprendimientoId) : [...prev, emprendimientoId]
        );
    };

    const handleAssign = () => {
        if (selectedEvaluador && selectedEmprendimientos.length > 0) {
            console.log('Evaluador:', selectedEvaluador);
            console.log('Emprendimientos seleccionados:', selectedEmprendimientos);
        } else {
            console.error('Selecciona un evaluador y al menos un emprendimiento');
        }
    };

    return (
        <Container>
            <BlurOverlay>
                <Logo src={logo} alt="Logo" />
                <Title>Asignación de emprendimientos para evaluación</Title>
                <ContentContainer>
                    <EvaluadoresContainer>
                        <h2>Evaluadores</h2>
                        {evaluadores.map(evaluador => (
                            <EvaluadorItem
                                key={evaluador.id}
                                onClick={() => handleEvaluadorClick(evaluador)}
                            >
                                {evaluador.nombre}
                            </EvaluadorItem>
                        ))}
                    </EvaluadoresContainer>
                    <EmprendimientosContainer>
                        <h2>Emprendimientos Disponibles</h2>
                        {emprendimientos.map(emprendimiento => (
                            <EmprendimientoItem
                                key={emprendimiento.id}
                                selected={selectedEmprendimientos.includes(emprendimiento.id)}
                                onClick={() => handleEmprendimientoClick(emprendimiento.id)}
                            >
                                {emprendimiento.nombre}
                            </EmprendimientoItem>
                        ))}
                    </EmprendimientosContainer>
                </ContentContainer>
                <ButtonContainer>
                    <Button onClick={handleAssign}>Asignar</Button>
                </ButtonContainer>
            </BlurOverlay>
        </Container>
    );
};

export default AsignacionEmprendimientos;
